import { Link } from 'react-router-dom';
import './register.scss';
import { useState, ChangeEvent } from 'react';
import axios from 'axios';

type valueType = {
  username: string;
  email: string;
  password: string;
  name: string;
};
const Register: React.FC = () => {
  const [value, setValue] = useState<valueType>({
    username: '',
    email: '',
    password: '',
    name: '',
  });

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    setValue({ ...prev, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    try {
      const data = await axios.post('http://localhost:9999/backend/auth/register', value);
    } catch (error) {
      alert('Не удалось зарегистрироваться, попробуйте снова');
      console.log(error);
    }
  };
  return (
    <div className="register">
      <div className="card">
        <div className="left">
          <h1>RogaleV</h1>
          <p>Welcome in our world! Join by other billion users!</p>
          <span>Do you have account?</span>
          <Link to="/login">
            <button>Login</button>
          </Link>
        </div>
        <div className="right">
          <h1>Register</h1>
          <form>
            <input type="text" placeholder="Your name" name="name" onChange={handleChange} />
            <input type="email" placeholder="Email" name="email" onChange={handleChange} />
            <input type="text" placeholder="Username" name="username" onChange={handleChange} />
            <input type="password" placeholder="Paswword" name="password" onChange={handleChange} />
            <button onClick={handleSubmit}>Register</button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Register;
